create sequence nomenclatures_id_seq;
alter sequence nomenclatures_id_seq owner to postgres;

create table nomenclatures
(
    id           bigint default nextval('nomenclatures_id_seq'::regclass) not null
        constraint nomenclatures_pkey
            primary key,
    comment      text                                                     not null,
    price        double precision,
    manufacturer varchar(50),
    nomenclature varchar(255)                                             not null,
    code         varchar(20),
    submitdate   timestamp with time zone,
    expireddate  timestamp with time zone,
    categoryid   bigint
);

